 <tr>
  <td valign="top" align="left" bgcolor="#A3CE06" width="30%" style="font-size:10pt;padding-left:10px;"><font color="#ffffff"><b>商品名</b></font>
  </td>
  <td valign="top" align="left" bgcolor="#ffffff" width="70%" style="font-size:10pt;padding-left:10px;">reef/リーフ/KNIT EYE</td>
 </tr>
 <tr>
  <td valign="top" align="left" bgcolor="#A3CE06" style="font-size:10pt;padding-left:10px;"><font color="#ffffff"><b>サイズ</b></font>
  </td>
  <td valign="top" align="left" bgcolor="#ffffff" style="font-size:10pt;padding-left:10px;">フリー</td>
 </tr>
 <tr>
   <td valign="top" align="left" bgcolor="#A3CE06" style="font-size:10pt;padding-left:10px;"><font color="#ffffff"><b>カラー</b></font> </td>
   <td valign="top" align="left" bgcolor="#ffffff" style="font-size:10pt; padding-left:10px; color: #000000;"><p>Brown</p>
    </td>
 </tr>
 <tr>
  <td valign="top" align="left" bgcolor="#A3CE06" style="font-size:10pt;padding-left:10px;"><font color="#ffffff"><b>詳細</b></font>
  </td>
  <td valign="top" align="left" bgcolor="#ffffff" style="font-size:10pt; padding-left:10px; color: #000000;"><p>1984年からのREEFの歴史は、アルゼンチン出身のFernandoとSantiagoの二人の兄弟から始まる。 サーフィンへの熱い情熱とユニークな企業家精神に動かされ、 兄弟はハイクオリティでアクティブなライフスタイルを象徴するサンダルの実現に向けて取り組んだ。 現在ではサーフアイデンティティを残し、街にいても、山にいても海を感じることのできるアイテムを中心に、 海をテーマにしたライフスタイルブランドとして確立している。</p>    </td>
 </tr>
 <tr>
  <td valign="top" align="left" bgcolor="#A3CE06" style="font-size:10pt;padding-left:10px;"><font color="#ffffff"><b>備考</b></font>
  </td>
  <td valign="top" align="left" bgcolor="#ffffff" style="font-size:10pt;padding-left:10px;">
<font color="#EC6B76">※画面上と実物では多少色具合が異なって見える場合もございます。ご了承ください。</font><br><br>
商品は当店他店舗でも販売しております。在庫数の更新は随時行っておりますが、お買い上げいただいた商品が、品切れになってしまうこともございます。その場合、お客様には必ず連絡をいたしますが万が一入荷予定がない場合は、キャンセルさせていただく場合もございますことをあらかじめご了承ください。
  </td>
 </tr>
</table>
